import React from 'react';

import { Button, ButtonToolbar, ButtonProps } from 'react-bootstrap';

class User extends React.Component {

  render() {

    return (
      <div>

        <ButtonToolbar>

          <Button bsStyle="primary">Primary</Button>

        </ButtonToolbar >

      </div>
    );
  }

}

export default User;
